import './App.css';

function App() {
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">

                {/* <button onClick={() => time()}>click</button> */}
                <p id="local-time-stamp"/>
                {time()}
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

function time(){
    console.log("hi")
    var now_time = new Date();
    console.log(now_time.toLocaleDateString())
    document.getElementById("local-time-stamp").innerHTML = String(now_time.toLocaleTimeString());
}

export default App;
